function CartSummary (props){
   console.log("/////cart from redux",props.cart)
    return(
     <div>
       <div>
         {props.cart?.length>0 && props.cart.map((object,value)=>{

              <label>hello</label>

         })}
         </div>
     </div>
    )
}
export default connect(function (state,props) {
    return{
    cart:state?.cart
    }
})(CartSummary)
